INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 2, 0, 0, "ペコリーヌとの出会い", 10118, 91002, "青空の下で謁見", 5118061, 2834, "フリーマーケット会場", 7, 40, 8, 1);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 2, 0, 0, "マホとの出会い", 10118, 91002, "未来の騎空団\nマスコット？", 5118062, 2835, "フリーマーケット会場", 7, 40, 8, 1);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 2, 0, 0, "アキノとの出会い", 10118, 91002, "お嬢さまからの\n緊急依頼", 5118063, 2837, "ランドソル市街地", 7, 40, 8, 1);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 2, 0, 0, "ジュンとの出会い", 10118, 91002, "黄金色の悩みごと", 5118064, 4108402, "フリーマーケット会場", 18, 40, 8, 1);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 2, 0, 0, "カオリとの出会い", 10118, 91002, "白熱！　格闘大会！", 5118065, 4107402, "フリーマーケット会場", 18, 40, 8, 1);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 2, 1, 0, "ニノンとの出会い", 10118, 91002, "祭り太鼓はオーエドの華", 5118066, 9000227, "オーエド町", 16, 40, 8, 1);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 3, 0, 0, "スズナとの出会い", 10118, 91002, "人気者は遅れて\nやってくる", 5118067, 2101181, "フリーマーケット会場", 19, 40, 8, 1);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 3, 0, 0, "ナナカとの出会い", 10118, 91002, "巫女・ミーツ・魔法少女", 5118068, 4109402, "ランドソル市街地", 18, 40, 8, 1);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 3, 0, 0, "キャル＆コッコロとの出会い", 10118, 91002, "ネズ耳は二度なくなる", 5118069, 4305402, "フリーマーケット会場", 18, 40, 8, 1);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 3, 0, 0, "ユカリとの出会い", 10118, 91002, "この出会いにカンパイ！", 5118070, 4101402, "ランドソル市街地", 18, 40, 8, 1);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 3, 0, 0, "アオイとの出会い", 10118, 91002, "陰陽アンサンブル", 5118071, 4106402, "ランドソル市街地", 18, 40, 8, 1);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES ("ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 3, 1, 0, "シノブとの出会い", 10118, 91002, "運試し十番勝負！", 5118072, 2836, "フリーマーケット会場", 7, 40, 8, 1);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 1, 0, 10145115, "オープニング", 10118, 0, "彼女たちの新たな日常", 5118600, 0, 0, 0, 0, 0, 0);
